'''Tabacundo''' is the seat of [[Pedro Moncayo Canton]], [[Pichincha Province]], [[Ecuador]]. Tabacundo is on the southeastern foothills of [[Mojanda]] Volcano. It is northeast of the city of [[Quito]] and west of the city of [[Cayambe (canton seat)|Cayambe]].
